import React, { Suspense } from 'react';
import Icon from './Icon';
import * as icons from '../Icons';
import ThemeProvider from '../../utils/theme';
export default {
  title: 'Icon',
  component: Icon,
  parameters: {
    layout: 'centered'
  },
  tags: ['autodocs'],
  argTypes: {}
};
const keys = Object.keys(icons);
const iconsEx = keys.map(item => {
  return {
    name: item
  };
});
const Story = () => {
  console.error('icons', iconsEx);
  return <ThemeProvider>
      <Suspense fallback={<div>Loading...</div>}>
        {iconsEx.map(item => {
        const IconComponent = item[item.name];
        return <div key={item[name]}>
              <span style={{
            fontSize: '10px',
            color: '#fff'
          }}>
                {item[name]}
              </span>
              <IconComponent />
            </div>;
      })}
      </Suspense>
    </ThemeProvider>;
};
export const Docs = Story.bind({});
Docs.parameters = {
  ...Docs.parameters,
  docs: {
    ...Docs.parameters?.docs,
